import React from 'react'
import { useNavigate } from 'react-router-dom';

const ProtectedRoute = ({children}) => {

    const navigate = useNavigate();


    let auth = 'false';
    if (!auth){
        return navigate('/login');
    }

  return (
    children
  )
}

export default ProtectedRoute
